  min-width: 40rem;
  min-height: 40rem;
  max-width: 40vw;
  max-height: 80vh;
  position: absolute;
  animation-name: rotation;
  animation-duration: 30s;
  animation-iteration-count: infinite;
  animation-timing-function: linear;
}
@keyframes rotation {
  0% {
    transform: rotate(0deg);
  }
  100% {
    transform: rotate(360deg);
  }
}

