    width: 100vw;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
    background: #00000000;
    .dialog_box {
        position: absolute;
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: column;
        min-width: 40rem;
        min-height: 40rem;
        max-width: 40vw;
        max-height: 80vh;

        h1 {
            max-width: 80%;
            font-style: normal;
            font-weight: bold;
            font-size: 2.5rem;
            line-height: 100%;
            text-align: center;
            color: #FFFFFF;
            text-shadow: 0px 4px 24px rgba(255, 255, 255, 0.25);
        }
        & h5 {
            color: #FFFFFF;
            font-size: 1.2rem;
            font-style: normal;
            font-weight: bold;
            line-height: 100%;
            text-align: center;
        }
        p {
            margin: 1rem 0;
            max-width: 80%;
            text-align: center;
            font-style: normal;
            font-weight: normal;
            font-size: 1.2rem;
            line-height: 140%;
            text-align: center;
            color: #FFFFFF;
            opacity: 0.5;
        }
        .dialog_info {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            align-items: center;
            min-width:  80%;
            max-width: 80%;
            .dialog_textarea {
                background: rgba(255, 255, 255, 0.05);
                border: 0.1rem solid rgba(255, 255, 255, 0.3);
                box-sizing: border-box;
                border-radius: 0.2rem;
                resize: none;
                width: 80%;
                height: 6rem;
                padding: 1rem;
